// frontend/src/components/Dashboard.js
import React, { useEffect, useState } from 'react';
import { Card, Row, Col } from 'react-bootstrap';
import { getStats } from '../services/api';

export default function Dashboard({ refresh }) {
  const [stats, setStats] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    loadStats();
  }, [refresh]);

  async function loadStats() {
    try {
      const data = await getStats();
      setStats(Array.isArray(data) ? data : []);
    } catch (err) {
      console.error('Failed to load stats:', err);
      setStats([]);
    } finally {
      setLoading(false);
    }
  }

  if (loading) return <div className="text-center">Loading dashboard...</div>;

  const totalSpent = stats.reduce((sum, month) => sum + (month.totalCost || 0), 0);
  const totalLiters = stats.reduce((sum, month) => sum + (month.totalLiters || 0), 0);
  const avgPrice = totalLiters > 0 ? totalSpent / totalLiters : 0;

  return (
    <div>
      <h4>Dashboard</h4>
      
      {/* Summary Cards */}
      <div className="row mb-4">
        <div className="col-md-3 mb-3">
          <div className="card dashboard-card text-center">
            <div className="card-body">
              <div className="card-title">Total Spent</div>
              <h3 className="text-primary">₹{totalSpent.toFixed(2)}</h3>
            </div>
          </div>
        </div>
        <div className="col-md-3 mb-3">
          <div className="card dashboard-card text-center">
            <div className="card-body">
              <div className="card-title">Total Liters</div>
              <h3 className="text-success">{totalLiters.toFixed(2)}L</h3>
            </div>
          </div>
        </div>
        <div className="col-md-3 mb-3">
          <div className="card dashboard-card text-center">
            <div className="card-body">
              <div className="card-title">Avg Price/L</div>
              <h3 className="text-warning">₹{avgPrice.toFixed(2)}</h3>
            </div>
          </div>
        </div>
        <div className="col-md-3 mb-3">
          <div className="card dashboard-card text-center">
            <div className="card-body">
              <div className="card-title">Entries</div>
              <h3 className="text-info">{stats.length}</h3>
            </div>
          </div>
        </div>
      </div>

      {/* Monthly Breakdown */}
      {stats.length > 0 && (
        <div className="card">
          <div className="card-header">
            <h5 className="mb-0">Monthly Breakdown</h5>
          </div>
          <div className="card-body">
            <div className="table-responsive">
              <table className="table">
                <thead>
                  <tr>
                    <th>Month/Year</th>
                    <th>Total Cost</th>
                    <th>Total Liters</th>
                    <th>Avg Price/L</th>
                  </tr>
                </thead>
                <tbody>
                  {stats.map((month, index) => (
                    <tr key={index}>
                      <td>{month._id?.month || 'N/A'}/{month._id?.year || 'N/A'}</td>
                      <td>₹{(month.totalCost || 0).toFixed(2)}</td>
                      <td>{(month.totalLiters || 0).toFixed(2)}L</td>
                      <td>₹{(month.avgPrice || 0).toFixed(2)}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}
